import { useContext} from "react";

import {HttpContext} from "../Http/GetData";
import CardData from "./CardData";
function Home() {
  const context = useContext(HttpContext);
  context.getData('us');
  return (
    <CardData contextData={context}/>
  );
}

export default Home;
